import AddTask from './components/AddTask'
import Home from './components/Home';


function App() {
  let nav = useNavigate()
  useEffect(()=>{
    nav
  },[])
  return (
    <div>
      <BrowserRouter>
        <Home/>
        <Routes>
          <Route element={<AddTask />} path='/addtask' />
          <Route element={<Home />} path='/home' />
        </Routes>
      </BrowserRouter>
    </div>

  );
}

export default App;
